 function Sobrenos(){

    return(
        <>
        <Header/>
    <h1>QUEM SOMOS</h1>
    <p>Quando pensar em oftalmologia, pense em um novo conceito de saúde ocular. Com duas unidades hospitalares, o H.Olhos conta com o que há de mais avançado em relação aos cuidados com a visão aliado a um atendimento humanizado, oferecendo tecnologias compatíveis com os maiores centros especializados do mundo.
Tudo isso para cuidar do que realmente importa para nós: você.</p>

    </>
    )
    }

